// Todo a component that creates a sidebar menu on the left side of the screen on the file SidebarData.js
// The sidebar menu has a login and register button
// The sidebar menu has a list of links to other pages
// the sidebar is expandable and collapsable
// The sidebar menu has a search bar
// the sidebar has a toggle button to expand and collapse the sidebar

import React from 'react'

import './SidebarData.css'

function SidebarData() {
    return (
        <div className="sidebar">
            <div className="sidebar__login">
                <button className="sidebar__loginButton">Login</button>
                <button className="sidebar__registerButton">Register</button>
            </div>
            <div className="sidebar__search">
                <input type="text" placeholder="Search.." name="search" />
                <button type="submit"><i className="fa fa-search"></i></button>
            </div>
            <div className="sidebar__menu">
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
                <Link to="/services">Services</Link>
                <Link to="/clients">Clients</Link>
            </div>
        </div>
    )
}


export default SidebarData
